import React from 'react'
import {Link,useNavigate} from 'react-router-dom'
import {ToastContainer,toast} from 'react-toastify'
import 'react-toastify/dist/ReactToastify.css';
import axios from "axios";

const Content = () => {

  const navigate = useNavigate();

  const navigated = () =>{
    navigate('/');
    toast.success("Sign Up SuccessFully")
  }
  return (
    <div className='container'>
      <div className="container" style={{margin:'0 auto',width: '50%',marginTop:'8rem'}}>
       <form style={{backgroundColor:'#dee2e6'}}>
        <div className="container text-center p-5">
            <h2 className='text-center'>Sign Up</h2>
            <input type='text' placeholder='name' className='form-control  ' name="name"  />
            <input type="email" placeholder='Email' className='form-control   my-4' name="email" />
            <input type="password" placeholder='Password' className='form-control  my-4' name="password" />
            <input type="password" placeholder='Conform Password' className='form-control   my-4' name="cpassword" />
            <button className='btn btn-success' onClick={navigated}>SignUp</button>
        </div>
       </form>
      </div>
    </div>
  )
}

export default Content
